import React, { useState, useEffect } from 'react';
import { leerRentas } from '../../../../../DataBase/DataOperations';

function ReadRents() {
    const [rentas, setRentas] = useState([]);

    useEffect(() => {
        cargarRentas();
    }, []);

    const cargarRentas = async () => {
        try {
            const rentasData = await leerRentas();
            setRentas(rentasData);
        } catch (error) {
            console.error('Error al cargar rentas:', error);
        }
    };

    return (
        <div>
            <h2>Lista de Rentas</h2>
            <table>
                <thead>
                    <tr>
                        <th>ID Usuario</th>
                        <th>ID Película</th>
                        <th>Fecha de Renta</th>
                        <th>Días de Renta</th>
                        <th>Estatus</th>
                    </tr>
                </thead>
                <tbody>
                    {rentas.map((renta, index) => (
                        <tr key={index}>
                            <td>{renta.idUsuario}</td>
                            <td>{renta.idPelicula}</td>
                            <td>{renta.fecha_renta}</td>
                            <td>{renta.dias_de_renta}</td>
                            <td>{renta.estatus}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default ReadRents;
